import React, {useState} from 'react'

function UserDashboard() {

    // funcion getMiDashboardDate

    const user ={}


    const userPro ={}


    const [flag, setFlag] = useState(false)

    const changeState=()=>setFlag(!flag)

    return (
        <div>
            {flag===true && 'tomate'}
            <div>
                <button onClick={changeState} >Change Type Of User</button>
            </div>
            USER / PROFESIONAL DETAILS ACCOUNT 
        </div>
    )
}

export default UserDashboard
